import React from "react";
import "../styles/recommendations.css";
import backgroundImage from "../components/background1.webp"; // ✅ Import image

const Recommendations = () => {
  return (
    <div
      className="page recommendations"
      style={{ backgroundImage: `url(${backgroundImage})` }} // ✅ Apply inline
    >
      <h1>Recommendations Page</h1>
    </div>
  );
};

export default Recommendations;
